jQuery(document).ready(function(){$('a[href="#"]').click(function(b){b.preventDefault()});$('[data-toggle="tooltip"]').tooltip();var a=(function(){var i=new Date();var c=i.getDay();var h=["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"];var b=i.getDate();var g=i.getMonth();var f=["January","February","March","April","May","June","July","August","September","October","November","December"];var e=i.getYear()+1900;switch(b){case (b%10)==1:b+="<sup>St</sup>";break;case (b%10)==2:b+="<sup>Nd</sup>";break;case (b%10)==3:b+="<sup>Rd</sup>";break;default:b+="<sup>Th</sup>"}return{day:h[c],date:b,month:f[g],year:e}})();$(".todayDateTop").empty().append(a.day+", "+a.date+" "+a.month+" "+a.year)});